function myMain() {
  var nt = Number(prompt("how many times (pos integer)?"));
  var msg = validate(nt);
  if (msg!=="ok") { alert(msg); return; }
  var ua, ub, uc;
  var avg;
  for ( var i=1; i<=nt; i++ ) {
    // solve the problem
    ua = Number(prompt("first pos integer?"));
    msg = validate(ua);
    if (msg!=="ok") { alert(msg); return; }
    ub = Number(prompt("second pos integer?"));
    msg = validate(ub);
    if (msg!=="ok") { alert(msg); return; } 
    uc = Number(prompt("third pos integer?"));
    msg = validate(uc);
    if (msg!=="ok") { alert(msg); return; } 
    avg = ( ua + ub + uc ) - Math.min(ua,ub,uc);
    avg = avg/2;
    alert("avg: " + avg);
  }
}

function validate ( data ) {
  if (isNaN(data)) { return("not num"); }
  if ( !isInt(data) ) { return("not int"); }
  if (data<=0) { return("not pos"); }
  return("ok");
}

function isInt ( val ) {
  if (isNaN(val)) { return false; }
  return (val%1)===0 ; 
}

