      var numm=prompt("what number?")
      if (isNaN(numm)) {alert("bad num"); break;}
      var nummm=Number(nummm);
      ans=ans*nummm;
      alert(ans)
    }
      if (ask==='d') {
      var numd=prompt("what number?")
      if (isNaN(numd)) {alert("bad num"); break;}
      if (ask===0) {alert("zero div"); alert(ans); continue;}
      var numdd=Number(numdd);
      ans=ans/numdd;
      alert(ans);
    }
      if (ask==='rt') {
        if (!isPos(ans)) {alert("neg total"); alert(ans); continue;}
        ans=Math.sqrt(ans);
        alert(ans);

    }
      if (ask==='tr') {
      var truans=trunc(ans);
       ans=truans
       alert(ans);
    }
    if (ask==='sq') {
      var sqans=Math.sq(ans);
      ans=sqans;
      alert(ans);
    }
   if (ask==='q') {alert("done"); break;}
     else {alert("bad op"); break;}
  }



function isPos (val) {

  if (isNaN(val)) {
   return false; 
  }
  return (val>0);
}


function trunc ( val ) {
  if (val<0) {return Math.ceil(val);}
  else {return Math.floor(val); }

}

