function makeNewAthlete (n) {
  var player = [];
  player = n.split("#");
  var obj = {
    id: player[0],
    name: player[1],
    games: player[2],
    fga: player[3],
    fgm: player[4],
    fta: player[5],
    ftm: player[6],
    totalPts: function () { return (this.fgm*2)+(this.ftm); },
    fgPct: function () { return trunc(this.fgm/this.fga); },
    ftPct: function () { return trunc(this.ftm/this.fta); },
    ptsPerGame: function () { return trunc(this.totalPts/this.games); },
  };

  return obj;
}

