    shuffle: function(times) {
  		for(var i=1; i<=times; i=i+1) {
    		var slot1= genRandomInt(0, this.numCards-1);
    		var slot2= genRandomInt(0, this.numCards-1);
    		var temp= this.cards[slot1];
    		this.cards[slot1]=this.cards[slot2];
    		this.cards[slot2]=temp;
        }
