  for (var i=0; i<arr.length-1; i++) {
    alert(arr[i]*arr[i+1]);
  }
}

function reCurser(arr,i) {
  if (i>=arr.length-1) { return; }
  alert(arr[i]*arr[i+1]);
  reCurser(arr,i+1);
}

