function myMain() {
  var nums = [10,20,30,40,50,60,70,80];

  alert("looping");
  alert( sumLooper(nums) );

  alert("recursion");
  alert( sumRecurser(nums) );
}

function sumLooper(arr) {
  var sum=0;
  for (var i=0; i<arr.length; i++) {
    sum += arr[i];
  }
  return sum;
}

function sumRecurser (arr) {
  if (arr.length===0) { return 0; }
  return arr[0] + sumRecurser(arr.slice(1));
}

