    if(Number(user) > 50) {greater50 = greater50 + 1;}
    if(threefiven(Number(user))) {three = three + Number(user);}
  }
  alert(greater50 + less50);
  alert(three);
}

function threefiven(number) {
  var result = 0;
  if(number % 3 === 0 || number % 5 === 0) {
    result = true;
  } else {
    result = false;
  }
  return result;  
}

