  var dna = prompt("What DNA sequence?");
  var pair = prompt("What base pair?");
  var matches = 0;
  while(pair != "done") {
    for(var i = 0; i <= dna.length - pair.length; i++) {
      var match = true;
      for(var j = 0; j < pair.length; j++) {
        if(dna[i + j] != pair[j]) {
          match = false;
          break;
        }
      }
      if(match) {
        matches++;
      }
    }
    alert("Base pair '" + pair + "' occurs " + matches + " times in DNA sequence '" + dna + "'");
    matches = 0;
    pair = prompt("What base pair?");
  }
}

